class Solution(object):
    def isAnagram(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """
        c_dict = dict()
        for c in s:
            if c in c_dict:
                c_dict[c] = c_dict[c] + 1
            else:
                c_dict[c] = 1

        for c in t:
            if c in c_dict:
                c_dict[c] = c_dict[c] - 1
            else:
                c_dict[c] = 1

        for c in c_dict:
            if c_dict[c] != 0:
                return False

        return True

