class Solution(object):
    def mergeTrees(self, t1, t2):
        """
        :type t1: TreeNode
        :type t2: TreeNode
        :rtype: TreeNode
        """
        if t1 is None and t2 is None:
            return None

        if t1:
            n1 = t1.val
        else:
            n1 = 0

        if t2:
            n2 = t2.val
        else:
            n2 = 0

        new_root = TreeNode(n1 + n2)
        first = new_root
        self.mergeNode(t1, t2, new_root)
        return first

    def mergeNode(self, t1, t2, new_root):

        if t1 is None and t2 is None:
            return

        # left
        n1 = 0
        n2 = 0
        if t1:
            t1_left = t1.left
            if t1_left:
                n1 = t1_left.val
        else:
            t1_left = None
        if t2:
            t2_left = t2.left
            if t2_left:
                n2 = t2.left.val
        else:
            t2_left = None
        if t1_left is None and t2_left is None:
            new_root.left = None
        else:
            n = n1 + n2
            new_root.left = TreeNode(n)

        n1 = 0
        n2 = 0
        if t1:
            t1_right = t1.right
            if t1_right:
                n1 = t1_right.val
        else:
            t1_right = None
        if t2:
            t2_right = t2.right
            if t2_right:
                n2 = t2.right.val
        else:
            t2_right = None
        if t1_right is None and t2_right is None:
            new_root.right = None
        else:
            n = n1 + n2
            new_root.right = TreeNode(n)

        if new_root.left:
            self.mergeNode(t1_left, t2_left, new_root.left)
        if new_root.right:
            self.mergeNode(t1_right, t2_right, new_root.right)

