20. 有效的括号
原题链接
思路

字符串每个字符按顺序入栈
入栈时检测当前字符和栈顶字符是否为括号匹配，若匹配则弹出栈顶元素，不匹配则直接入栈
最后判断栈是否为空

写的比较蠢了，Python 可以直接用字典来匹配括号，这里用了 if。
class Solution(object):
    def isValid(self, s):
        """
        :type s: str
        :rtype: bool
        """
        stack = list()
        for c in s:
            if stack:
                top = stack[len(stack) - 1]

                if c == ')':
                    if top == '(':
                        stack.pop()
                    else:
                        stack.append(c)
                elif c == '}':
                    if top == '{':
                        stack.pop()
                    else:
                        stack.append(c)
                elif c == ']':
                    if top == '[':
                        stack.pop()
                    else:
                        stack.append(c)
                else:
                    stack.append(c)
            else:
                stack.append(c)
        if stack:
            return False
        else:
            return True

